import React, { useEffect } from 'react'
import { Tooltip, IconButton, TextField } from '@material-ui/core'
import AddIcon from '@material-ui/icons/Add';

export default class Dashboard extends React.Component {

    componentDidMount() {
        let uid = sessionStorage.getItem("uid");
        fetch('http://sddmajordev:5000/api/userbase/verify_user', {
            method: 'post',
            headers: {
              'Content-Type':  'application/json',
            }, 
            body: JSON.stringify(this.state)
          })
          .then(response => response.json())
          .then(data => {
            sessionStorage.setItem("access_token", data.access_token)
            sessionStorage.setItem("uid", data.uid)
            window.location = "/dashboard";
        })
    }

    render() {
        return (
            <div>
                <Tooltip title="Add Teacher">
                <IconButton aria-label="delete" style={{backgroundColor: "#FF7979", float: "right"}}>
                    <AddIcon />
                </IconButton> 
                </Tooltip>
                <h1 style={{textAlign: "center"}}>Hello, Dillon</h1>
                <TextField label="Search Wordlist" variant="outlined"></TextField>
            </div>
        )
    }
}
